import React, { useState } from 'react';
import { PrimaryNav, MenuLink, Menu, Hamburger } from './NavElement';
import { Link, useNavigate } from 'react-router-dom'; // Promijenjen import za useNavigate
import RegistrationForm from './RegistrationForm';

const Navbar = () => {
  const [showRegistrationForm, setShowRegistrationForm] = useState(false);
  const navigate = useNavigate(); // Koristimo useNavigate za navigaciju

  const handleRegisterClick = () => {
    setShowRegistrationForm(true);
  };

  const handleMenuLinkClick = (to) => {
    navigate(to); // Koristimo navigate za navigaciju na određenu rutu
  };

  return (
    <PrimaryNav>
      <Hamburger />
      <Menu>
        <MenuLink to="/home" activeStyle onClick={() => handleMenuLinkClick('/home')}>
          Home
        </MenuLink>
        <MenuLink to="/about" activeStyle onClick={() => handleMenuLinkClick('/about')}>
          About
        </MenuLink>
        <MenuLink to="/products" activeStyle onClick={() => handleMenuLinkClick('/products')}>
          Products
        </MenuLink>
        <li>
          <Link to="/login">Login</Link>
        </li>
        <li>
          <Link to="/register" onClick={handleRegisterClick}>
            Register
          </Link>
        </li>
      </Menu>
      {showRegistrationForm && <RegistrationForm />}
    </PrimaryNav>
  );
};

export default Navbar;
